CREATE TABLE member (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    login VARCHAR(250) NOT NULL,
    givenname VARCHAR(250) NOT NULL,
    familyname VARCHAR(250) NOT NULL,
    email VARCHAR(250) NOT NULL,
    plainpassword VARBINARY(64) NOT NULL,
    CONSTRAINT ux_member_name UNIQUE (login)
);

CREATE TABLE folder (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    member_id INT NOT NULL,
    title VARCHAR(250) NOT NULL,
    CONSTRAINT fk_folder__member FOREIGN KEY (member_id) REFERENCES member (id),
    CONSTRAINT ux_folder_title UNIQUE (member_id, title)
);

CREATE TABLE note (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    member_id INT NOT NULL,
    folder_id INT NOT NULL,
    title VARCHAR(250) NOT NULL,
    content TEXT NOT NULL,
    CONSTRAINT fk_note__member FOREIGN KEY (member_id) REFERENCES member (id),
    CONSTRAINT fk_note__folder FOREIGN KEY (folder_id) REFERENCES folder (id),
    CONSTRAINT ux_note_title UNIQUE (member_id, title)
);

CREATE TABLE picture (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    member_id INT NOT NULL,
    note_id INT NOT NULL,
    title VARCHAR(250) NOT NULL,
    data BLOB NOT NULL,
    CONSTRAINT fk_picture__member FOREIGN KEY (member_id) REFERENCES member (id),
    CONSTRAINT fk_picture__note FOREIGN KEY (note_id) REFERENCES note (id),
    CONSTRAINT ux_picture_title UNIQUE (note_id, title)
);
